import FooterComponent from './components/FooterComponent';
import CreateUserComponent from './components/CreateUserComponent';
import ViewUserComponent from './components/ViewUserComponent';
import UpdateUserComponent from './components/UpdateUserComponent';


function App() {
  return (
    <div>
        <BrowserRouter>
              <HeaderComponent />
                <div className="container">
                    <Routes> 
                          <Route path = "/" element = {<ListUserComponent />}></Route>
                          {/* <Route path = "/add-task" component = {CreateUserComponent}></Route>
                          <Route path = "/list/all" component = {ViewUserComponent}></Route>
                          <Route path = "/update/taskStatus" component = {UpdateUserComponent}></Route> */}
                    </Routes>
                </div>
              <FooterComponent />
        </BrowserRouter>
    </div>

  );
}

export default App;
